ot going to censor my words).<br/><br/>So, im saying, real hostility and consequences with Ryan and Kieran, mike created. Hes on good terms with tony still though. But, I am hoping, and what some anons are expecting, is a bit of a "break up in the band" going on with this new disaster of a show.<br/><a href=https://kissu.moe/qa/res/8801.html>https://kissu.moe/qa/res/8801.html</a>
