                                                        								<br />
							
								So I have an idea on how to deal with imageboards with bad moderation that I&#39;ve been stewing on a bit. The problem to solve is that you have two or more people wanting to talk to each other, but a mod on the board is stopping at least one of them from posting. So he needs to join the conversation another way. The traditional solution would be ghostposting. This, of course, depends on everyone else knowing about it, but that can be overcome.<br/><br/>Some of the problems with ghostposting are:<br/>(1) ghostposting isn&#39;t the archive&#39;s main goal so if the archive runs into problems with spammers, rather than trying to moderate, they&#39;ll often do things like impose crippling captchas or shut off ghostposting entirely<br/>(2) ghostposting by itself doesn&#39;t do anything to move people off a badly moderated board<br/><br/>So the idea is this: if there&#39;s a thread on one imageboard, and someone makes a thread on another imageboard linking to it, by some method alert the participants in the the first thread of the second, without anyone having to go post in the first thread, which we&#39;ll presume is crawling with obsessed hotpockets. Something like this could perhaps be implemented in 4chan X.<br/><br/>There are some design issues to think about.<br/><br/>For example, what form should such an alert take in the UI? Would it be sufficient to alert people who have the thread open, or should there be consideration of people who have the thread in their thread watcher? Would it be a good idea to add the second thread automatically to the watcher if somebody is watching the first, or should there be a different sort of alert with a choice of whether to add the second thread?<br/><br/>And how do we convey the information on a technical level? I can think of two ways of doing this, one having a list of board pairs, and whenever you&#39;re watching / opening a thread on the first board, your browser scans the second board for mentions of that thread. Another way would be to have a service that periodically scans imageboards for cross-site links and everyone&#39;s browser periodically downloads the list and uses it to check if the threads they&#39;re watching / opening are linked somewhere else. I can see problems with either approach; maybe you can think of something better. In any case, it ought to be possible for a user to subscribe to whatever servers or lists they choose.<br/><br/>Another thing to think about is whether this should be opt-in for the sites doing the linking or opt-out. (The sites being linked to would have no say in the matter.)<br/><br/>Any thoughs?<br/><a href=https://kissu.moe/qa/res/7601.html>https://kissu.moe/qa/res/7601.html</a>
                                                </div>
                                </div>
