								I wonder what imageboards will look like in five years, or even just one. Will there be more of them? Less?<br/>It&#39;s probably only a matter of time until 4chan has some severe legal issues that will close it down, but I wonder how it would happen in regards to other imageboards. I think most people would just return to solely using social media, but maybe about 5-10% of the posters, the older ones still habitually visiting, would scan out alternatives.<br/>I&#39;ve been watching the 8gag stuff pretty closely and it&#39;s an interesting view of how things might pan out if 4chan goes down. Some of the bunkers, even small ones, are saying to not link it anywhere, while others are trying to get the message out of their existence. <br/>Personally, I think they should be trying to get as many of their old users back as possible, but I can also understand the paranoia of outsiders.<br/><br/>What say you, /qa/?<br/><a href=https://kissu.moe/qa/res/7545.html>https://kissu.moe/qa/res/7545.html</a>
