                                                        								<p class="intro">
									<span class="subject">
										I&amp;#39;d just like to interject for a moment.
									</span>
								</p>
							
								What you&#39;re referring to as Zero Two, is in fact, GNU/Zero Two, or as I&#39;ve recently taken to calling it, GNU plus Zero Two. Zero Two is not an operating system unto itself, but rather another free component of a fully functioning GNU system made useful by the GNU corelibs, shell utilities and vital system components comprising a full OS as defined by POSIX.<br/><br/>Many computer users run a modified version of the GNU system every day, without realizing it. Through a peculiar turn of events, the version of GNU which is widely used today is often called "Zero Two", and many of its users are not aware that it is basically the GNU system, developed by the GNU Project.<br/><br/>There really is a Zero Two, and these people are using it, but it is just a part of the system they use. Zero Two is the kernel: the program in the system that allocates the machine&#39;s resources to the other programs that you run. The kernel is an essential part of an operating system, but useless by itself; it can only function in the context of a complete operating system. Zero Two is normally used in combination with the GNU operating system: the whole system is basically GNU with Zero Two added, or GNU/Zero Two. All the so-called "Zero Two" distributions are really distributions of GNU/Zero Two.<br/><a href=https://kissu.moe/qa/res/5145.html>https://kissu.moe/qa/res/5145.html</a>
                                                </div>
                                </div>
